main_text:
[형훈라멘, 2019]
류니끄, 소나와 같은 건물에 있는 형훈라멘. 근데 라멘 먹으러 온 거 아니야. 나는 양, 곱창, 대창 중에서 몸에 제일 안 좋은 대창을 제일 좋아하는데, 여기 대창덮밥은 튀긴 파를 곁들여 먹으면 JMT이야. 한정 판매라고 하니 먹고 싶으면 일찍 가.

